import React from 'react'

export default function PokemonStats(props) {

 console.log(props)



    return (
        <div className="stats">
                 <h2 className="stats_headng"> STATS </h2>   
                  {props.stats.map((item)=>{

                      if(item.stat.name!='special-attack' && item.stat.name!='special-defense'){
                        return (
                            <>
                            <div className='progress_container'>
                                <div className="progress"  style={{width:`${item.base_stat}`}}></div>
                            </div>
                            <div>
                                <h4 style={{display:'inline-block'}}>{item.stat.name} : </h4>
                                <span> {item.base_stat}</span>
                            </div>
                        </>)
                      }
                    
                  })
                  }        
        </div>
    )
}
